  02> WILLIAMS, Priscilla Jane
  b 17.06.1940
  Priscilla b, at Wanganui. Address: Ministry of Foreign Affairs & Trade, Private Bag,
  Wellington.
  Priscilla was educated at St Stephen's School, Marton, Nga Tawa School, Marton and
  Victoria University of Wellington (MA in History, 1963). She joined the Ministry of
  Foreign Affairs in 1961. She has held the positions of 3rd/2nd Secretary at the New
  Zealand High Commission in Malaysia (1964-66); 1st Secretary at the New Zealand
  Permanent Mission in New York (1969-74); Counsellor at the New Zealand Embassy to Thailand (1977-80);
  Head of Information Division, Wellington (1980-83); New Zealand High Commissioner to Tonga (1983-85)
  and Deputy High Commissioner, Australia (1986-89). From August 1989 until December 1992 she was New
  Zealand's High Commissioner to India with cross-accreditation as Ambassador to Nepal, High Commissioner
  to Bangladesh and responsibility for the relationship with Bhutan. On her return to New Zealand she
  was Director of the Environmental Division for two years, and then Director of the United Nations and
  Commonwealth Division from the beginning of 1996 until April 1998. In May 1998 she took up the
  appointment of New Zealand Consul General for New South Wales and Queensland, resident in Sydney,
  Australia.
  07> WILLIAMS, Herbert Meyric m on 20.12.1933 to PLUMMER, June
  b 07.01.1903 d 22.11.1983
  b 03.04.1912
  Meyric b, at Gisborne, m, at Tokomaru Bay and d. at Hastings. June, d/o Sidney James Plummer
  (b. in England) and Mary Alice Whitelaw (b. at Auckland). June b. at Auckland. Address: 56
  Essex Street, Masterton.
  Meyric was educated at Heretaunga School, Hastings (1912-15) and Wanganui Collegiate School
  and was a farmer. He became an expert on trees and was a pioneer in the use of trees to stop
  soil erosion. He was a foundation member of the Hawkes Bay branch of the New Zealand Farm
  and Forestry Association and was made a life member.
  June was educated at Woodford House, Havelock North. During WW2 she was a signaller with the Women's War
  Service. She has had an active involvement with the Plunket Society.
  01> WILLIAMS, Warwick Rodney m on 05.03.1957 to HASSALL, Henare Jane Shearburn
  b 10.10.1934
  b 25.05.1934
  Warwick b. at Te Awamutu and m. at Woodford House. Henare b. at Hastings. Address: "Erinui", Mount Erin
  Road, RD 2, Hastings.
  Warwick was educated at Nelson College and is now an orchardist. Henare was educated at Woodford House.
  b1> WILLIAMS, Hamish Warwick Hassall m on 11.02.1984 to (1) THOMAS, Bronwyn
  b 06.10.1958
  b 19.06.1962
